// ============================= Google Maps TEST =============================
// AIzaSyCoOZKGkK9Ili7RHCrB0dVNqhy6_e1yKyM

import React, { Component } from 'react';
import NavbarMaps from '../../components/common/navbarMaps';
import './maps.css'

class MapContainer extends Component {    
    // state = {
    //     h : this.props.location
        // h: "hello world",
        // test: this.props.state
    // };

    render() {
        return (  
            <div class="noscroll">
                <NavbarMaps />
                <div className="sidenav">
                    <div class="sidePlaceName">
                        {this.props.location.state.hello}
                    </div>
                </div>

            </div>
        );
    }
}

export default MapContainer;
